      table = ["" + "「宝物の迷宮」\n" + "財宝決定の際、1段階深度の高い財宝桌面を使用する。", "" + "「密林の迷宮」　初期深度+10\n" + "分類が「魔獣」「獣人」「霊獣」の怪獸は全ての判定に+2のボーナスを得る。", "" + "「カラクリ技師の迷宮」\n" + "分類「ギア」の怪獸は全ての判定に+2のボーナスを得る。\n" + "クリア時に獲得できるAPが2倍になる。", "" + "「フラウの舞踏会」\n" + "フラウが登場するランダムイベントが発生した際、\n" + "「この迷宮を制覇して、私達が舞踏会を開けるようにしてね」とお願いされ、\n" + "迷宮クリア時の獲得CPに+1のボーナスを得る。", "" + "「アズマ風の迷宮」　初期深度+10\n" + "風流なアズマ風の迷宮。\n" + "アシガルファイター(CL4)、アンブッシュマン(CL5)、カラクリフラウ(CL6)、\n" + "ヤコ(CL6)、ヤシャ(CL10)、ヒトキリ(CL33)、シャドウストーカー(CL35)、\n" + "アシュラ(CL48)、コンゴウ(CL60)、カラクリヒメショーグン(CL75)が行う、\n" + "全ての判定に+2のボーナスを得る。", "" + "「枯れた泉の迷宮」　初期深度+5\n" + "回復の泉が全て枯れており、回復効果を得ることができない。毒の泉はそのまま存在する。", "" + "「天空への道」　初期深度+15\n" + "上へ上へと果てしなく昇っていく迷宮。空気が薄くなって疲労しやすくなる。\n" + "技などによるFPの最終的な消費と、FPに受ける最終的なダメージが2倍になる。", "" + "「灼熱焦土の塔」　初期深度+10\n" + "とてつもなく熱く、気温が50度以上の塔。\n" + "「特性：火炎」の攻撃でPCが受ける最終的なダメージが2倍になる。", "" + "「永久凍土の塔」　初期深度+10\n" + "とてつもなく寒く、気温が氷点下の塔。\n" + "「特性：冷気」の攻撃でPCが受ける最終的なダメージが2倍になる。\n" + "リザードやワイズマンなどの寒さに弱い角色は動きが鈍り、あらゆる判定に-2のペナルティを受ける。", "" + "「盗賊王の迷宮」　初期深度+10\n" + "<罠><鍵開け>に+3のペナルティを受ける。", "" + "「ミミック狂暴化」\n" + "「全地形2-5」のミミックを見破る<罠>の判定に-3のペナルティを受け、\n" + "ミミックの致傷力も2倍になる。ミミックから獲得できるGPが3倍になる。", "" + "「トレジャーイーター狂暴化」　初期深度+10\n" + "「全地形2-6」のトレジャーイーターを見破る<罠>の判定に-5のペナルティを受ける。", "" + "「暗闇の迷宮」　初期深度+5\n" + "「暗視」がなければ視覚判定に-5のペナルティを受ける。\n" + "ストームコーザーはペナルティが2倍。", "" + "「騒音の迷宮」　初期深度+5\n" + "「音量自動補正装置」がなければ聴覚判定に-5のペナルティを受ける。\n" + "シルヴァテイルはペナルティが2倍。", "" + "「未知の怪物の迷宮」　初期深度+10\n" + "怪獸のデータが判明させられなくなる。\n" + "怪獸名は全て「謎の影」となる", "" + "「氾濫中の迷宮」　初期深度+10\n" + "<水泳>に-5のペナルティを受ける。", "" + "「間抜けの迷宮」　初期深度+15\n" + "あらゆる知力を基準とした判定（精神系技能含む）に-2のペナルティを受ける。", "" + "「瘴気の迷宮」　初期深度+15\n" + "あらゆる生命力判定に-4のペナルティを受ける。", "" + "「加速する迷宮」\n" + "1ラウンドで1日が経過する迷宮。技のCTやフラウの水分補給に影響する。\n" + "「CT:1日」までの技も次ターンで使用可能になっている。", "" + "「停滞する迷宮」\n" + "敵味方双方が、「CT:次ターン」の技を使用すると最終イベントまで再使用不可。\n" + "また、「次ターンまで」有効な技は最終イベントまでずっと適用される。", "" + "「猛毒の迷宮」　初期深度+20\n" + "最大HP、MP、FPに-5のペナルティを受ける。最低1点は残る。\n" + "中級:-10 上級:-15　悪夢:-20", "" + "「死の迷宮」　初期深度+25\n" + "「保険」の効果が適用されない迷宮。", "" + "「幸運の迷宮」\n" + "PC全員のフォーチュン最大値+1。", "" + "「不運の迷宮」　初期深度+10\n" + "PC全員のフォーチュン最大値が半減する。", "" + "「レアメタルの迷宮」\n" + "非常にレアな怪獸「レアメタルキャンディー」「レアメタルクラウン」が生息している迷宮。\n" + "キャンディークラウン(CL40)、ゴールデンクラウン(CL177)から\n" + "獲得できるAPが5倍になる。ただし、この2体の防護点は10になる。", "" + "「魔力の泉」\n" + "PCと怪獸の双方が、MPを減少させずに魔法を使用できるようになる。\n" + "最大MPの足りていない魔法は使用できない。", "" + "「青色の迷宮」　初期深度+10\n" + "PCは全員「内気3」の特徴を得る。\n" + "迷宮内で他のNPCに出会った際のイベントは全て無視する。", "" + "「赤色の迷宮」　初期深度+10\n" + "PCは全員「直情」「自信過剰」の特徴を得る。「撤退」はできなくなる。", "" + "「ピンクの迷宮」\n" + "PCは全員「好色」「平和愛好/専守防衛」の特徴を得る。「分類：魔族」とのエンカウントは無視する。", "" + "「ハズレの迷宮」\n" + "財宝決定の際、1段階深度の低い財宝桌面を使用する。", "" + "「ラダマンティスの迷宮」　初期深度+20\n" + "「分類：岩石」の怪獸は全ての判定に+3のボーナスを得る。\n" + "また、「遺跡6-6」のイベントの致傷力が2倍になる。", "" + "「グレイヴディガーの迷宮」　初期深度+20\n" + "「分類：アンデッド」の怪獸は全ての判定に+3のボーナスを得る。\n" + "また、「墓場」の深度判定に-5のペナルティを受ける。", "" + "「ハイペリオンの迷宮」　初期深度+20\n" + "全ての怪獸がターンの最初にHPを5点ずつ回復する。\n" + "中級:10点　上級:20点　悪夢:30点。", "" + "「ムスペルニブルの迷宮」　初期深度+20\n" + "「特性：火炎」「特性：冷気」の攻撃で、PCが受ける最終的なダメージが2倍になる。", "" + "「  の迷宮」\n" + "何も起きない。第五魔将の封印が解除されている場合のみ、フォーチュン最大値+5。", "" + "「バロールの迷宮」　初期深度+20\n" + "「分類：ギア」の怪獸は全ての判定とあらゆる攻撃の致傷力に+3のボーナスを得る。"];
